import React, { Component, useState } from 'react';
import { 
    StyleSheet, 
    SafeAreaView, 
    Button, 
    View,
    Text,
    TouchableOpacity,
    TextInput
} from 'react-native';

function CustomerAdd() {
    return (
        <SafeAreaView style={styles.container}>
            <Text>Add Page</Text>
        </SafeAreaView>
    );
}


const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      justifyContent: 'flex-end',
    },

});

export default CustomerAdd;
